import { EventsList } from "../components";

function EventsPage() {
  return <EventsList />;
}

export default EventsPage;

export const eventLoader = async () => {
  const response = await fetch("http://localhost:8080/events");

  if (!response.ok) {
    throw { message: "An error occured" };
  } else {
    return response;
  }
};
